import React, { useState } from "react";
import {
  TextField,
  Select,
  MenuItem,
  InputLabel,
  FormControl,
  Button,
  Container,
  Typography,
  Radio,
  RadioGroup,
  FormControlLabel,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const PersonalInfoPage = () => {
  const navigate = useNavigate();
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [nickname, setNickname] = useState("");
  const [age, setAge] = useState("");
  const [maritalStatus, setMaritalStatus] = useState("");
  const [gender, setGender] = useState("");
  const [lgbt, setLgbt] = useState(0);

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const userId = 1; // this should come from the logged-in user
      const response = await axios.post("/api/personal-info", {
        userId,
        firstName,
        lastName,
        nickname,
        age,
        maritalStatus,
        gender,
        lgbt,
      });
      if (response.data.success) {
        navigate("/dashboard");
      }
    } catch (error) {
      console.error("Error submitting personal info:", error);
    }
  };

  return (
    <Container maxWidth="xs">
      <Typography variant="h4">Personal Information</Typography>
      <form onSubmit={handleSubmit}>
        <TextField
          fullWidth
          label="First Name"
          variant="outlined"
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
          margin="normal"
        />
        <TextField
          fullWidth
          label="Last Name"
          variant="outlined"
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
          margin="normal"
        />
        <TextField
          fullWidth
          label="Nickname"
          variant="outlined"
          value={nickname}
          onChange={(e) => setNickname(e.target.value)}
          margin="normal"
        />
        <FormControl fullWidth margin="normal">
          <InputLabel>Age</InputLabel>
          <Select
            value={age}
            onChange={(e) => setAge(e.target.value)}
            label="Age"
          >
            {Array.from({ length: 100 }, (_, index) => (
              <MenuItem key={index} value={index + 1}>
                {index + 1}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl fullWidth margin="normal">
          <InputLabel>Marital Status</InputLabel>
          <Select
            value={maritalStatus}
            onChange={(e) => setMaritalStatus(e.target.value)}
            label="Marital Status"
          >
            <MenuItem value="single">Single</MenuItem>
            <MenuItem value="inrelationship">In a Relationship</MenuItem>
            <MenuItem value="married">Married</MenuItem>
          </Select>
        </FormControl>
        <FormControl component="fieldset" margin="normal">
          <RadioGroup
            value={gender}
            onChange={(e) => setGender(e.target.value)}
            row
          >
            <FormControlLabel value="male" control={<Radio />} label="Male" />
            <FormControlLabel
              value="female"
              control={<Radio />}
              label="Female"
            />
          </RadioGroup>
        </FormControl>
        <FormControl component="fieldset" margin="normal">
          <RadioGroup
            value={lgbt}
            onChange={(e) => setLgbt(Number(e.target.value))}
            row
          >
            <FormControlLabel value={0} control={<Radio />} label="No" />
            <FormControlLabel value={1} control={<Radio />} label="Yes" />
          </RadioGroup>
        </FormControl>
        <Button type="submit" variant="contained" color="primary" fullWidth>
          Submit
        </Button>
      </form>
    </Container>
  );
};

export default PersonalInfoPage;
